import React, { Component } from 'react';
import './profileGrid.css'

class ProfileGrid extends Component {
    render() { 
        return ( 
            <div className="profile-grid">
                <div className="grid-wrapper">
                    <div className ='pictures'>1</div>
                    <div className ='pictures'>2</div>
                    <div className ='pictures'>3</div>
                </div>
                <div className="grid-wrapper">
                    <div className ='pictures'>4</div>
                    <div className ='pictures'>5</div>
                    <div className ='pictures'>6</div>
                </div> 
            </div>
        );
    }
}

export default ProfileGrid;
